import React, { useState } from "react";
import { Link } from "react-router-dom";

const VideoManagement = () => {
  const [videoData, setVideoData] = useState([
    { id: 1, title: "Video 1", youtubeLink: "https://www.youtube.com/watch?v=xxx" },
    { id: 2, title: "Video 2", youtubeLink: "https://www.youtube.com/watch?v=yyy" },
    { id: 3, title: "Video 3", youtubeLink: "https://www.youtube.com/watch?v=zzz" },
  ]);

  const [newVideo, setNewVideo] = useState({ title: "", youtubeLink: "" });
  const [editingVideoId, setEditingVideoId] = useState(null);
  const [editedVideo, setEditedVideo] = useState({ title: "", youtubeLink: "" });
  const [message, setMessage] = useState("");
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [videoToDelete, setVideoToDelete] = useState(null);

  const [searchQuery, setSearchQuery] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const videosPerPage = 3;

  // Filter videos based on search query
  const filteredVideos = videoData.filter(
    (video) =>
      video.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
      video.id.toString().includes(searchQuery)
  );

  const indexOfLastVideo = currentPage * videosPerPage;
  const indexOfFirstVideo = indexOfLastVideo - videosPerPage;
  const currentVideos = filteredVideos.slice(indexOfFirstVideo, indexOfLastVideo);
  const totalPages = Math.ceil(filteredVideos.length / videosPerPage);

  const handleCreateVideo = () => {
    if (newVideo.title && newVideo.youtubeLink) {
      setVideoData([...videoData, { id: videoData.length + 1, ...newVideo }]);
      setNewVideo({ title: "", youtubeLink: "" });
      setMessage("Video added successfully.");
      setTimeout(() => setMessage(""), 3000);
    } else {
      alert("Please fill all fields for the video.");
    }
  };

  const handleEditVideo = (video) => {
    setEditingVideoId(video.id);
    setEditedVideo({ title: video.title, youtubeLink: video.youtubeLink });
  };

  const handleUpdateVideo = () => {
    if (editedVideo.title && editedVideo.youtubeLink) {
      setVideoData(
        videoData.map((video) =>
          video.id === editingVideoId ? { ...video, ...editedVideo } : video
        )
      );
      setEditingVideoId(null);
      setEditedVideo({ title: "", youtubeLink: "" });
      setMessage("Video updated successfully.");
      setTimeout(() => setMessage(""), 3000);
    } else {
      alert("Please fill all fields to update the video.");
    }
  };

  const handleCancelEdit = () => {
    setEditingVideoId(null);
    setEditedVideo({ title: "", youtubeLink: "" });
  };

  const handleDeleteVideo = (id) => {
    setShowDeleteModal(true);
    setVideoToDelete(videoData.find((video) => video.id === id));
  };

  const confirmDeleteVideo = () => {
    setVideoData(videoData.filter((video) => video.id !== videoToDelete.id));
    setShowDeleteModal(false);
    setVideoToDelete(null);
    setMessage("Video deleted successfully.");
    setTimeout(() => setMessage(""), 3000);
  };

  const cancelDelete = () => {
    setShowDeleteModal(false);
    setVideoToDelete(null);
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h2 className="text-2xl font-bold text-center mb-6">Video Management</h2>
      {message && <div className="bg-green-100 text-green-800 p-4 rounded-md mb-4">{message}</div>}

      {/* Search Bar */}
      <div className="flex justify-end mb-4">
        <input
          type="text"
          placeholder="Search by ID or Title"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="p-2 border border-gray-300 rounded-md"
        />
      </div>

      {/* Add New Video */}
      <div className="mb-4 grid grid-cols-3 gap-2">
        <input
          type="text"
          placeholder="Title"
          value={newVideo.title}
          onChange={(e) => setNewVideo({ ...newVideo, title: e.target.value })}
          className="p-2 border border-gray-300 rounded-md"
        />
        <input
          type="text"
          placeholder="YouTube Link"
          value={newVideo.youtubeLink}
          onChange={(e) => setNewVideo({ ...newVideo, youtubeLink: e.target.value })}
          className="p-2 border border-gray-300 rounded-md"
        />
        <button
          onClick={handleCreateVideo}
          className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600"
        >
          Add Video
        </button>
      </div>

      {/* Edit Video Form */}
      {editingVideoId && (
        <div className="mb-4">
          <h3 className="text-lg font-bold">Edit Video</h3>
          <input
            type="text"
            placeholder="Title"
            value={editedVideo.title}
            onChange={(e) => setEditedVideo({ ...editedVideo, title: e.target.value })}
            className="p-2 border border-gray-300 rounded-md mb-2"
          />
          <input
            type="text"
            placeholder="YouTube Link"
            value={editedVideo.youtubeLink}
            onChange={(e) => setEditedVideo({ ...editedVideo, youtubeLink: e.target.value })}
            className="p-2 border border-gray-300 rounded-md mb-2"
          />
          <button
            onClick={handleUpdateVideo}
            className="bg-green-500 text-white px-4 py-2 rounded-md mr-2 hover:bg-green-600"
          >
            Save Changes
          </button>
          <button
            onClick={handleCancelEdit}
            className="bg-gray-400 text-white px-4 py-2 rounded-md"
          >
            Cancel
          </button>
        </div>
      )}

      {/* Video Table */}
      <table className="w-full table-auto text-left bg-white rounded-md shadow-md">
        <thead className="bg-blue-500 text-white">
          <tr>
            <th className="p-4">ID</th>
            <th className="p-4">Title</th>
            <th className="p-4">YouTube Link</th>
            <th className="p-4">Actions</th>
          </tr>
        </thead>
        <tbody>
          {currentVideos.map((video) => (
            <tr key={video.id} className="border-b">
              <td className="p-4">{video.id}</td>
              <td className="p-4">{video.title}</td>
              <td className="p-4">{video.youtubeLink}</td>
              <td className="p-4">
                <button
                  onClick={() => handleEditVideo(video)}
                  className="bg-green-500 text-white px-2 py-1 rounded-md mr-2 hover:bg-green-600"
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDeleteVideo(video.id)}
                  className="bg-red-500 text-white px-2 py-1 rounded-md hover:bg-red-600"
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pagination */}
      <div className="mt-4 flex justify-center items-center gap-4">
        <button
          onClick={() => setCurrentPage((prev) => prev - 1)}
          disabled={currentPage === 1}
          className={`px-4 py-2 rounded-md ${
            currentPage === 1
              ? "bg-gray-300 cursor-not-allowed"
              : "bg-blue-500 text-white hover:bg-blue-600"
          }`}
        >
          Previous
        </button>
        <span>
          Page {currentPage} of {totalPages}
        </span>
        <button
          onClick={() => setCurrentPage((prev) => prev + 1)}
          disabled={currentPage === totalPages}
          className={`px-4 py-2 rounded-md ${
            currentPage === totalPages
              ? "bg-gray-300 cursor-not-allowed"
              : "bg-blue-500 text-white hover:bg-blue-600"
          }`}
        >
          Next
        </button>
      </div>

      {/* Delete Confirmation Modal */}
      {showDeleteModal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
          <div className="bg-white p-6 rounded-lg shadow-lg">
            <h3 className="text-lg font-bold mb-4">Confirm Deletion</h3>
            <p>Are you sure you want to delete "{videoToDelete?.title}"?</p>
            <div className="flex justify-end gap-4 mt-4">
              <button
                onClick={confirmDeleteVideo}
                className="bg-red-500 text-white px-4 py-2 rounded-md hover:bg-red-600"
              >
                Delete
              </button>
              <button
                onClick={cancelDelete}
                className="bg-gray-400 text-white px-4 py-2 rounded-md"
              >
                Cancel
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Dashboard Button */}
      <div className="mt-6">
        <Link
          to="/Dashboard"
          className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600"
        >
          Dashboard
        </Link>
      </div>
    </div>
  );
};

export default VideoManagement;
